import React from 'react';
import css from './topbar.module.css';

export default function Topbar() {
    return (
        <div className={css.top}>
            <div className={css.topLeft}></div>
            <div className={css.topCenter}></div>
            <div className={css.topRight}></div>

        </div>
    );
}
